import {
    GET_DOGS,
    GET_TEMPERAMENTS,
} from "./actions"


const initialState = {
    dogs : [],
    allDogs: [],
    temperaments: [],
    detail: [],

} 


function rootReducer(state = initialState, action) {
    switch (action.type) {
        case GET_DOGS:
            return {
                ...state,
                dogs: action.payload,
                allDogs: action.payload,
                detail: []

            }
        case GET_TEMPERAMENTS:
            return {
                ...state,
                temperaments: action.payload
            }
        default:
            return state;
    }
}

export default rootReducer;
